import React, { Component } from "react";
import Box from "./box";

class Game extends Component {
  state = {
    boxes: [
      { id: 1, value: "" },
      { id: 2, value: "" },
      { id: 3, value: "" },
      { id: 4, value: "" },
      { id: 5, value: "" },
      { id: 6, value: "" },
      { id: 7, value: "" },
      { id: 8, value: "" },
      { id: 9, value: "" }
    ],
    X_turn: true
  };
  handleClick() {
    this.setState({ X_turn: !this.state.X_turn });
    console.log("Clicked!", this.state.X_turn);
  }
  render() {
    return (
      <div className="game">
        {this.state.boxes.map(box => (
          <Box key={box.id} onClick={this.handleClick} box={box}>
            {box.value}
          </Box>
        ))}
      </div>
    );
  }
}

export default Game;
